pragma solidity 0.8.17;

import "../lib/struct/LEnumerableSet.sol";
import "../lib/struct/LEnumerableMap.sol";
import "../proxy/BaseUUPSStorage.sol";

abstract contract AccessControlStorage is BaseUUPSStorage {
  using LEnumerableSet for LEnumerableSet.AddressSet;
  using LEnumerableSet for LEnumerableSet.Bytes32Set;
  using LEnumerableMap for LEnumerableMap.Bytes32ToBytes32Map;
  using LEnumerableMap for LEnumerableMap.AddressToUintMap;

  enum Status {
    NONE,
    ENABLED,
    DISABLED
  }

  struct RoleStat {
    bytes32 role;
    Status status;
  }

  struct Context {
    bytes32 realm;
    address contractId;
    bool isEnabled;
    mapping(bytes4 => RoleStat) resources; // function selector => RoleStat
    LEnumerableSet.Bytes32Set funcSet;
  }

  struct Role {
    string name;
    bytes32 group;
    bool isEnabled;
    LEnumerableSet.AddressSet accountSet;
  }

  struct Realm {
    string name;
    bool isEnabled;
    bool isUpgradable;
    LEnumerableSet.Bytes32Set ctxSet;
  }

  struct Group {
    string name;
    bool isEnabled;
    LEnumerableSet.Bytes32Set roleSet;
  }

  struct DataMaps {
    mapping(address => mapping(bytes32 => Status)) accountMap;
    mapping(bytes32 => Context) ctxMap;
    mapping(bytes32 => Role) roleMap;
    mapping(bytes32 => Realm) realmMap;
    mapping(bytes32 => Group) groupMap;
  }

  DataMaps internal _dataMaps;
}
","keccak256":"0xc5e4ec7a55d2f136e8c7e552a6f0cb24d3c5f2223fe230b2356dc708dc6c97b1","license":"MIT"},"src/contracts/acl/IContextManagement.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

interface IContextManagement {
  enum UpdateContextStatus {
    DISABLE,
    ENABLE,
    REMOVE
  }

  struct RequestContext {
    bytes32 name;
    bytes32 version;
    bytes32 realm;
    address contractId;
    bool status;
  }

   struct RequestPredictContext {
    bytes32 name;
    bytes32 version;
    bytes32 realm;
    bytes32 salt;
    address subject;
    address deployer;
    bool status;
  }

  struct RequestRegisterContext {
    bytes32 role;
    bytes4[] funcSelectors;
    bool isEnabled;
  }

  struct RequestUpdateContext {
    bytes32 role;
    bytes4[] funcSelectors;
    UpdateContextStatus updateStatus;
  }

  struct ResponseContext {
    bytes32 name;
    bytes32 version;
    bytes32 realm;
    address contractId;
    bool isSafeMode;
    bool isUpgradable;
  }

  event ContextRegistered(bytes32 indexed context, address indexed contractId, address indexed sender, address signer, bytes32 realm);

  event PredictContextRegistered(bytes32 indexed context, address indexed contractId, address indexed sender, address signer, address deployer, address subject, bytes32 realm);

  event ContextUpdated(bytes32 indexed context, address indexed contractId, address indexed sender, bytes32 realm);

  event ContextStatusChanged(bytes32 indexed context, address indexed sender, bytes32 indexed realm, bool status);

  event ContextFuncRoleAdded(
    bytes32 indexed context,
    bytes32 indexed role,
    address indexed sender,
    bytes4 functionSelector,
    bytes32 realm
  );

  event ContextFuncRemoved(bytes32 indexed context, address indexed sender, bytes4 functionSelector, bytes32 realm);

  event ContextRoleGranted(
    bytes32 indexed context,
    bytes32 indexed role,
    address indexed sender,
    bytes4 functionSelector,
    bytes32 realm
  );

  event ContextRoleRevoked(
    bytes32 indexed context,
    bytes32 indexed role,
    address indexed sender,
    bytes4 functionSelector,
    bytes32 realm
  );

  event ContextRealmChanged(bytes32 indexed context, address indexed sender, bytes32 indexed realm, bytes32 oldRealm);

  function registerContext(
    bytes memory signature,
    RequestContext calldata rc,
    RequestRegisterContext[] calldata rcr
  ) external returns (bytes32);

  function registerPredictContext(
    bytes memory signature,
    RequestPredictContext calldata rpc,
    RequestRegisterContext[] calldata rrc
  ) external returns (bytes32);

  function updateContext(
    bytes32 ctx,
    bytes memory signature,
    RequestContext calldata rc,
    RequestUpdateContext[] calldata ruc
  ) external returns (address);

  function addContextFuncRole(
    bytes32 ctx,
    bytes4 functionSelector,
    bytes32 role
  ) external returns (bool);

  function removeContextFunc(bytes32 ctx, bytes4 functionSelector) external returns (bool);

  function grantContextRole(
    bytes32 ctx,
    bytes4 functionSelector,
    bytes32 role
  ) external returns (bool);

  function revokeContextRole(
    bytes32 ctx,
    bytes4 functionSelector,
    bytes32 role
  ) external returns (bool);

  function setContextRealm(bytes32 ctx, bytes32 realm) external returns (bool);

  function setContextStatus(bytes32 ctx, bool status) external returns (bool);

  function hasContextRole(
    bytes32 ctx,
    bytes32 role,
    bytes4 functionSelector
  ) external view returns (bool);

  function getContextInfo(bytes32 ctx) external view returns (ResponseContext memory);

  function getContextFuncs(bytes32 ctx) external view returns (bytes4[] memory);
}
